19	10	uk	2018-12-12 10:13:58.436478	2018-12-12 10:28:17.461088	Сергій Моргунов	<div>Запрошуємо до співпраці у реалізації спільних інвестиційних ініціатив!</div>\r\n	<div>Вінниця &ndash; сучасне місто, економіка якого динамічно розвивається. Місто має тривалі промислові традиції, потужну освітню базу, наукові школи, які працюють у сфері інформаційних технологій, інженерії, медицини. Вінниця характеризується вигідним географічним розташуванням, що є його однією з ключових конкурентних переваг. За період незалежності економіка міста суттєво трансформувалась: відбувся структурний зсув від галузей машинобудування, електронної та хімічної промисловості в бік харчової промисловості, торгівлі та сфери послуг. Протягом останніх років міська влада активно працює над залученням інвестицій та розвитком промислового сектору. Інвестиційний паспорт буде цікавий та корисний приватним інвесторам, представникам іноземних компаній, громадянам міста і України.</div>\r\n
20	10	en	2018-12-12 10:13:58.437797	2018-12-12 10:28:17.463851	Serhii Morhunov	<div>We invite you to cooperate in realization of joint investment initiatives!</div>\r\n	<div>Vinnytsia is a modern city, the economy of which is developing dynamically. The city has long industrial traditions, a powerful educational base, scientific schools that work in the field of information technology, engineering, medicine. Vinnytsia is characterized by an advantageous geographical location, which is one of its key competitive advantages. During the period of independence, the city&#39;s economy significantly transformed: there was a structural shift from the mechanical engineering, electronic and chemical industries to the food industry, trade and services. In recent years, the city authorities have been actively working on attracting investment and developing the industrial sector. The investment passport will be interesting and useful for private investors, representatives of foreign companies, citizens of the city and Ukraine.</div>\r\n
