1	1	uk	2018-08-22 15:16:25.186799	2018-09-05 15:37:16.57415	Вигідне географічне положення	<h1><span style="font-size:20px;"><span style="font-family:ProximaNova-Light;">Сучасна транспортна інфраструктура Вінниці, географічне положення та розвинена промисловість створюють передумови для створення в місті потужного логістичного хабу</span></span></h1>\r\n	<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;"><meta charset="utf-8" /></span></span></p>\r\n\r\n<h1 style="margin-right: 0cm; margin-left: 0cm; text-align: center;"><span style="font-size:28px;"><span style="color:#c0392b;"><span style="font-family:ProximaNova-Light;">Міжнародний АЕРОПОРТ &laquo;Вінниця&raquo; </span></span></span></h1>\r\n\r\n<h1 style="margin-right: 0cm; margin-left: 0cm; text-align: center;"><span style="font-size:28px;"><span style="color:#c0392b;"><span style="font-family:ProximaNova-Light;">(IATA:VIN, ICAO:UKWW)</span></span></span></h1>\r\n\r\n<p style="margin-right: 0cm; margin-left: 0cm; text-align: center;"><span style="font-size:28px;"><span style="color:#c0392b;"><span style="font-family:ProximaNova-Light;"><img alt="" src="/uploads/ckeditor/pictures/16/content_%D0%90%D0%B5%D1%80%D0%BE%D0%BF%D0%BE%D1%80%D1%82.jpg" style="width: 650px; height: 388px;" /></span></span></span></p>\r\n\r\n<p style="margin-right: 0cm; margin-left: 0cm; text-align: justify;"><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Муніципальний проект, весь цілісний майновий комплекс &ndash; 100% власність територіальної громади міста. </span></span></p>\r\n\r\n<p style="margin-right: 0cm; margin-left: 0cm; text-align: justify;"><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Знаходиться в центрі України, розташований в 7,5 км на схід від залізничної станції Вінниця, має злітно-посадкову смугу 2500х42 м з твердим покриттям та здатний обслуговувати повітряні судна індексу 6 (шість) та нижче (А320, В737, Ту-1154, Як &ndash; 42, SAAB &ndash; 340 та інші) за напрямами сполучення аеропорти України, Європи та Близького сходу. </span></span></p>\r\n\r\n<p style="margin-right: 0cm; margin-left: 0cm; text-align: justify;"><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Пропускна спроможність 400 пасажирів на годину. </span></span></p>\r\n\r\n<p style="margin-right: 0cm; margin-left: 0cm; text-align: justify;"><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Сполучення з 3000 аеропортів 80 міст, 40 країн світу.</span></span></p>\r\n\r\n<p style="margin-right: 0cm; margin-left: 0cm; text-align: justify;"><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Аеропорт в 2017 році зайняв перше місце по динаміці пасажиропотоку серед малих аеропортів України (до 100 тис. пасажирів на рік).</span></span></p>\r\n\r\n<p style="margin:0cm 0cm 8pt; margin-right:0cm; margin-left:0cm">&nbsp;</p>\r\n\r\n<h2 style="margin: 0cm 0cm 8pt; text-align: center;"><strong><span style="color:#c0392b;"><span style="font-family:ProximaNova-Light;">Перевагою міста є те, що воно розташоване на перетині двох європейських автомобільних маршрутів</span></span></strong></h2>\r\n\r\n<p dir="ltr" style="text-align: justify;"><img alt="" src="/uploads/ckeditor/pictures/19/content_%D0%BA%D0%B0%D1%80%D1%82%D0%B0.png" style="width: 800px; height: 566px; float: right;" /></p>\r\n\r\n<p dir="ltr">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Місто розташоване на перетині автомобільних доріг міжнародного значення <strong>М12 (Е50)</strong> і <strong>М21 (Е583)</strong> та залізничних шляхів, наближених до вузлових станцій, які поєднують між собою Західну, Південну, Центральну Україну та європейські міста.&nbsp;</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Важливою перевагою географічного розміщення міста є близькість до кордонів з <strong>Молдовою</strong> та <strong>Румунією</strong>.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Вінниця включена до масштабного дорожнього будівництва по проекту <strong>&laquo;Go Highway&raquo;</strong>. Цей міжнародний транспортний коридор з&rsquo;єднає порти Балтійського та Чорного моря. У межах Вінницької області протяжність цього шляху <strong>185,4 км.</strong></span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">У місті функціонує 3 автовокзали (центральний, західний, східний), з них 2 &ndash; міжнародних.</span></span></p>\r\n\r\n<p dir="ltr" style="text-align: justify;">&nbsp;</p>\r\n\r\n<p dir="ltr">&nbsp;</p>\r\n\r\n<p dir="ltr"><span style="font-family:ProximaNova-Light;"><span style="font-size:18px;">Залізничний вузол Вінниці забезпечує щоденне міжнародне пасажирське сполучення.&nbsp;</span></span></p>\r\n\r\n<p dir="ltr"><span style="font-family:ProximaNova-Light;"><span style="font-size:18px;"><img alt="" src="/uploads/ckeditor/pictures/23/content_%D0%B2%D1%96%D0%B4%D1%81%D1%82%D0%B0%D0%BD%D1%8C.png" style="width: 800px; height: 269px;" /></span></span></p>\r\n\r\n<p dir="ltr">&nbsp;</p>\r\n\r\n<p dir="ltr">&nbsp;</p>\r\n\r\n<p dir="ltr">&nbsp;</p>\r\n
