3	2	uk	2018-08-22 15:16:25.204349	2018-09-05 16:32:45.249248	Найкомфортніше місто для проживання	<h1><span style="font-size:20px;"><span style="font-family:ProximaNova-Light;">Чотири рази визнано найкращим містом для життя</span></span></h1>\r\n\r\n<h1><span style="font-size:20px;"><span style="font-family:ProximaNova-Light;">№ 1 в дослідженні &laquo;Індекс задоволеності якістю сфер та послуг&raquo;</span></span></h1>\r\n\r\n<h1><span style="font-size:20px;"><span style="font-family:ProximaNova-Light;">Один з кращих зразків громадського транспорту серед міст України</span></span></h1>\r\n\r\n<p><meta charset="utf-8" /></p>\r\n	<ul>\r\n</ul>\r\n\r\n<p><span style="font-family:ProximaNova-Light;"><span style="font-family:ProximaNova-Light;"><span style="font-size:18px;">Вінницю&nbsp;<strong>Чотири рази&nbsp;</strong>визнано найкращим містом для життя . Вперше у 2013 р. журнал &ldquo;Фокус&rdquo; оголосив Вінницю лідером рейтингу &ldquo;Найкращі міста для життя&ldquo;. В 2015, 2016 і 2017 роках Вінниця очолила подібний рейтинг від соціологічної групи &ldquo;Рейтинг&rdquo;.</span></span></span></p>\r\n\r\n<ul>\r\n\t<li><span style="font-family:ProximaNova-Light;"><span style="font-size:18px;"><strong>№ 1</strong> в дослідженні <strong>&laquo;Індекс задоволеності якістю сфер та послуг&raquo;</strong> 2017, 2018</span></span>*</li>\r\n\t<li>&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style="margin-right:0cm; margin-left:0cm"><span style="font-size:12pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><span style="font-size:13.5pt"><span style="font-family:&quot;ProximaNova-Light&quot;,serif">Один з кращих зразків громадського транспорту серед міст України. </span></span></span></span></p>\r\n\r\n<p align="center" style="text-align:center; margin-right:0cm; margin-left:0cm"><span style="font-size:12pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><span style="font-size:27.0pt"><span style="font-family:&quot;ProximaNova-Light&quot;,serif"><span style="color:#c0392b">63% мешканців найчастіше&nbsp;використовують громадський транспорт у пересуванні містом*</span></span></span></span></span></p>\r\n\r\n<p style="margin-right:0cm; margin-left:0cm"><span style="font-size:12pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><span style="font-size:13.5pt"><span style="font-family:&quot;ProximaNova-Light&quot;,serif">Загальна чисельність громадського&nbsp;транспорту міста &mdash; <strong>502 одиниці</strong></span></span></span></span></p>\r\n\r\n<p style="margin-right:0cm; margin-left:0cm"><span style="font-size:12pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><span style="font-size:13.5pt"><span style="font-family:&quot;ProximaNova-Light&quot;,serif">Пасажиропотік <strong>194 млн осіб в рік</strong></span></span></span></span></p>\r\n\r\n<p dir="ltr">&nbsp;</p>\r\n\r\n<p dir="ltr"><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;"><span style="line-height:107%"><span style="line-height:107%">*(за результатами всеукраїнського муніципального опитування на замовленя Міжнародного Республіканського Інституту).</span></span></span></span></p>\r\n
11	6	uk	2018-08-22 15:16:25.270813	2018-09-05 16:33:33.120204	Сприятливий інвестиційний клімат	<h1><span style="font-size:20px;"><span style="font-family:ProximaNova-Light;">80% прямих іноземних інвестицій в економіці міста надійшло з країн ЄС</span></span></h1>\r\n\r\n<p><span style="font-size:20px;"><span style="font-family:ProximaNova-Light;">Agrana Fruit, Barlinek, UBC Group і не тільки... обрали Вінницю</span></span></p>\r\n	<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p style="text-align: center;"><span style="color:#c0392b;"><span style="font-size:28px;"><span style="font-family:ProximaNova-Light;">Загальний обсяг залучених у економіку міста інвестицій в 2017 році склав 115,9 млн.дол.США, із яких 20 млн.дол.США. надійшло у 2017 р. </span></span></span></p>\r\n\r\n<p><span style="font-family:ProximaNova-Light;"><img alt="" src="/uploads/ckeditor/pictures/9/content_1.png" style="width: 650px; height: 359px;" /></span></p>\r\n\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<p style="text-align: center;"><span style="font-size:28px;"><span style="color:#c0392b;"><span style="font-family:ProximaNova-Light;">Структура ПІІ за галузями економіки</span></span></span></p>\r\n\r\n<p><span style="font-family:ProximaNova-Light;"><span style="font-size:14px;"><img alt="" src="/uploads/ckeditor/pictures/10/content_2.png" style="width: 450px; height: 294px;" /></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style="text-align: center;"><span style="color:#c0392b;"><span style="font-size:28px;"><span style="font-family:ProximaNova-Light;">Структура ПІІ за країнами походження</span></span></span></p>\r\n\r\n<p><span style="font-family:ProximaNova-Light;"><span style="font-size: 14px;"><img alt="" src="/uploads/ckeditor/pictures/11/content_3.png" style="width: 450px; height: 336px;" /></span></span></p>\r\n\r\n<p><span style="font-family:ProximaNova-Light;"><span style="font-size:18px;">У I півріччі 2018 р. рейтингове агентство &ldquo;<a href="http://ibi.com.ua/UK/company/vinnicya.html?type=ar&amp;ID=12">IBI - rating</a>&rdquo;&nbsp; підтвердило рейтинг інвестиційної привабливості міста на рівні <strong>invA+</strong> &ldquo;Висока інвестиційна привабливість&rdquo;. </span></span></p>\r\n\r\n<p><span style="font-family:ProximaNova-Light;"><span style="font-size:18px;">Рейтингове агентство &ldquo;<a href="http://www.credit-rating.ua/ru/events/press-releases/14365/">Credit-Rating</a>&rdquo; підвищило рейтинг інвестиційної привабливості міста до рівня <strong>uaA +</strong>.&nbsp; </span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;"><meta charset="utf-8" /></span></span></p>\r\n\r\n<p dir="ltr"><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;"><b id="docs-internal-guid-cb1b10f8-7fff-c42b-3028-0c42171022b3">Успішним досвідом роботи Вінниці з інвесторами є залучення відомих іноземних та вітчизняних корпорацій</b></span></span></p>\r\n\r\n<p><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">У Вінниці функціонує понад 200 промислових підприємств, серед яких ПАТ &laquo;Вінницький олійно-жировий комбінат&raquo; (промислова група ViОil), ПрАТ &laquo;Вінницька кондитерська фабрика&raquo; (ROSHEN), Спільне українсько-іспанське підприємство у формі ТОВ &laquo;Сперко Україна&raquo; (Компанія SPERCO), ТОВ &laquo;Аграна Фрут Україна&raquo; (група AGRANA), ТОВ &laquo;Барлінек Інвест&raquo; (Barlinek), ТОВ &laquo;Грін Кул&raquo; (UBC Group).</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n
