6	3	en	2018-08-31 16:12:18.709982	2018-11-28 22:50:29.324258	On September 7, 2018, VI International Investment Forum "Vinnytsya Region - Business in the Center of Ukraine" was held.	<p><span style="font-family:ProximaNova-Light;"><span style="font-size:16px;">September 7, 2018 at 11.30 at the address: Vinnitsa, st. Khmelnytsky highway, 7, Vinnytsia regional philharmonic named after M.D. Leontovich will host the International Investment Forum &quot;Vinnytsia Region - Business in the Center of Ukraine&quot;.</span></span></p>\r\n	<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">The purpose of the event is to intensify economic cooperation, present investment, economic, agricultural and tourist potential of the Vinnytsia region, as well as establish new partnerships and establish mutually beneficial cooperation.<br />\r\nPARTICIPANTS: Representatives of the Government of Ukraine and the diplomatic corps of foreign states, investment companies, international experts, representatives of business missions from partner regions and business circles.<br />\r\nRegistration form for the participants of the VI International Investment Forum &quot;Vinnitsa - Business in the Center of Ukraine&quot; under the <a href="https://goo.gl/forms/hewpZZybBXRUMWGC2" target="_blank">link.</a></span></span></p>\r\n
1	1	uk	2018-08-20 08:04:38.931147	2018-12-05 14:18:01.113278	У Вінниці підписали договір про створення та функціонування індустріального парку	<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">Сьогодні, 27 серпня, в приміщенні Вінницької міської ради підписали договір про створення та функціонування індустріального парку &laquo;Вінницький кластер холодильного машинобудування&raquo;. Договір підписано між Вінницькою міською радою, приватним акціонерним товариством &laquo;Українська пивна компанія&raquo; та товариством з обмеженою відповідальністю &laquo;Промислово-інвестиційна компанія&raquo;.</span></span></p>\r\n	<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">Завод з виробництва холодильного обладнання - перше підприємство, яке запрацює на території індустріального парку &laquo;Вінницький кластер холодильного машинобудування&raquo;. Вже розпочато випуск продукції в тестовому режимі та залучено 250 робітників. Підприємство буде введено в експлуатацію на початку вересня. До кінця 2018 року планується створити додатково до 750 робочих місць. Запланований обсяг реалізації продукції (І черги) - 400 млн. грн/рік, після реалізації ІІ черги (орієнтовний термін 2019-2020 рр.) &nbsp;&ndash; 700 млн. грн/рік та додатково 1000 робочих місць.&nbsp;</span></span></p>\r\n\r\n<blockquote>\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">&laquo;Сьогодні історична подія для міста Вінниці та для розвитку промисловості в місті. Ми фактично після підписання даної угоди повноцінно створюємо кластер холодильного обладнання безпосередньо у Вінниці. Якщо говорити про цілі та завдання, то я &nbsp;думаю що це перша така відправна точка розвитку і налагодження промислових можливостей і потужностей у нашому місті. На початку вересня розпочинає роботу перша черга заводу UBC Group по виготовленню холодильного обладнання. Сам кластер холодильного обладнання &ndash; це той майданчик, де будуть об&rsquo;єднанні всі суміжні підприємства, які виготовлятимуть холодильне об&rsquo;єднання. Важливо, що створюються нові робочі місця, це інвестиційна привабливість для всього нашого міста. Це такий гарний знак, що інвестори можуть заходити у місто Вінницю, і можуть тут працювати. І маю надію, що це стане поштовхом для економічної активності в місті. Важливо також, що залучення будь-якої інвестиції &ndash; це розвиток території в різних напрямках. Перша &ndash; це підготовка кваліфікованих кадрів. Якщо говорити на прикладі професійно-технічної освіти, то зрозуміло, що спеціалісти, які могли б працювати на тому обладнанні, яке є на цьому заводі, то таких спеціалістів поки що досить мало. Тобто це покращить якість освіти. Далі ми говоримо про створення робочих &nbsp;місць, зрозуміло, що це відповідні заробітні плати. Коли розвивається якесь виробництво &ndash; біля нього розвивається інфраструктура і інші підприємства. Зростає інвестиційна привабливість. Це активність міста в цілому. Чим більше ми будемо створювати робочих місць то, мабуть, ця активність буде краща&raquo; - зазначив міський голова Сергій Моргунов під час підписання договору.&nbsp;</span></span></p>\r\n</blockquote>\r\n\r\n<p><iframe allowfullscreen="true" allowtransparency="true" frameborder="0" height="315" scrolling="no" src="https://www.facebook.com/plugins/video.php?href=https%3A%2F%2Fwww.facebook.com%2FSAMorgunov%2Fvideos%2F1037780596373036%2F&amp;show_text=0&amp;width=560" style="border:none;overflow:hidden" width="560"></iframe></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">Завод уже почав працювати у тестовому режимі. Працівників навчають спеціалісти з інших країн. На початку вересня планується офіційне відкриття І черги нового заводу. &nbsp;Реалізація проекту передбачає залучення партнерів заводу з виробництва холодильного обладнання, а саме постачальників комплектуючих з теплообмінного обладнання, випарників і конденсаторів, компресорів та систем управління, завдяки чому на території індустріального парку буде створено повноцінний комплекс виробництва холодильного обладнання. Керуючою компанією на конкурсних засадах визначено ТОВ &laquo;Промислово-інвестиційна компанія&raquo;.</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">&laquo;Сьогоднішня подія &ndash; це усвідомлення того, що ми реалізуємо програму такого стратегічного партнерства між бізнесом, державою та суспільством. Головне для нашого бізнесу, адже ми міжнародна компанія, - &nbsp;це довіра людей. Виклик, який зараз перед нами стоїть, - це трудова міграція людей до Європи. Якщо довіри не буде, то робочі місця будуть, але постане питання, хто їх буде займати. Індустріальний парк &ndash; це має бути зразок того, що можна роботи бізнес по міжнародних стандартах тут у Вінниці. Я цілком впевнений в тому, що наші західні партнери зараз цим дуже зацікавлені. І вони теж будуть послідовні, і впевнений в тому, що вони інвестуватимуть у Вінницю. Ми прийняли рішення про будівництво заводу тут чотири роки тому, &nbsp;і коли визначались, проводили порівняння по 25 чинниках. Серед яких зокрема рівень кваліфікації людей, що дуже важливо для нас, а також підтримка місцевої влади, яка у Вінниці є зразком співробітництва бізнесу і влади, так має бути. &nbsp;Діапазон заробітної плати на нашому підприємстві буде вищий ніж ринковий. Ми граємо у вищій світовій лізі. Для нас важливо, щоб наші клієнти мали переваги від нашої діяльності. Якщо ми працюємо з &nbsp;Pepsi, це &nbsp;десь 30-40 країн операцій, то для них головне, щоб дотримувалися їх вимоги. З нами &laquo;грають&raquo; підприємства з Німеччини, Туреччини, Іспанії. Ми маємо створити такі умови, на яких люди будуть розвивати свою компетенцію та досвід, та мати такий рівень заробітної плати і умови такі, щоб люди залишалися працювати тут у Вінниці, а не їхати до Польщі чи Румунії&raquo;, - розповів директор ПрАТ &laquo;Українська пивна компанія&raquo; Ігор Бурдиленко</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">Довідка:</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">Компанія UBC Group є одним з найбільших виробників промислового холодильного обладнання в Східній Європі. Компанія працює понад 20 років та постачає продукцію у 120 країн світу. Серед її клієнтів є такі відомі торгові марки, як Coca-Cola, Pepsi, Carlsberg, Heineken, ABInBev, SABMiller, MolsonCoors, Nestl&eacute;.</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">В липні 2018 року проведено відкритий конкурс в вибору керуючої компанії індустріального парку &laquo;Вінницький кластер холодильного машинобудування&raquo;. Переможцем конкурсу обрано ТОВ &laquo;Промислово-інвестиційна компанія&raquo; (м. Харків).</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">Завод з виробництва холодильного обладнання - перше підприємство, яке запрацює на території індустріального парку &laquo;Вінницький кластер холодильного машинобудування&raquo;.&nbsp;</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">За попередніми розрахунками у 2019 році надходження до бюджету від діяльності індустріального парку становитиме 11,2 млн грн від сплати єдиного соціального внеску та 10,5 млн грн від сплати ПДФО, а у 2024 році &ndash; 56,1 млн та 45,9 млн грн відповідно.&nbsp;</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">Ініціаторами створення індустріального парку стали: Вінницька міська рада в частині земельної ділянки площею &ndash; 8,4176 га та ПрАТ &laquo;Українська пивна компанія&raquo; (UBC Group) - в частині земельної ділянки площею &ndash; 10,85 га.&nbsp;</span></span></p>\r\n
3	2	uk	2018-08-27 15:17:32.756637	2018-12-13 09:09:18.841926	Світовий лідер у виробництві спортивної амуніції «HEAD» має наміри інвестувати у Вінницю	<p style="margin: 0cm 0cm 10pt; text-align: justify;"><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;"><span style="line-height:150%"><span style="line-height:150%">Австрійська компанія &laquo;HEAD&raquo;, яка є найбільш упізнаваним у світі брендом у сфері гірськолижних видів спорту, має намір співпрацювати з Вінницькою міською радою, Вінницькою обласною адміністрацію та КП &laquo;ВМЦІ&raquo; в сфері підготовки кваліфікованих кадрів, створення нових робочих місць у Вінниці та розвитку промисловості з високою доданою вартістю. </span></span></span></span></p>\r\n	<p style="margin-bottom:.0001pt; text-align:justify; margin:0cm 0cm 10pt"><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;"><span style="line-height:150%"><span style="line-height:150%">4 травня 2018 року о 13.30 в Білій залі Вінницької міської ради відбулося підписання Меморандуму про порозуміння між компанією &laquo;HEAD&raquo;, в особі головного виконавчого директора компанії &laquo;HEAD&raquo; Йогана Еліаша (Johan Eliasch), Вінницькою обласною державною адміністрацією, Вінницькою міською радою та КП &laquo;Вінницький муніципальний центр інновацій&raquo; (&laquo;ВМЦІ&raquo;), за участі Директора Офісу із залучення та підтримки інвестицій UkraineInvest Данила Білака.</span></span></span></span></p>\r\n\r\n<p style="margin-bottom:.0001pt; text-align:justify; margin:0cm 0cm 10pt"><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;"><span style="line-height:150%"><span style="line-height:150%">&laquo;Підписанням цього меморандуму ми робимо перший крок у співпраці із відомою компанією &laquo;HEAD&raquo;. Це &ndash; історичний момент, і маю надію, що ця співпраця буде продовжуватись вже конкретними справами. Зі свого боку, як міський голова і представник команди міста Вінниці, я засвідчую подяку за початок цієї роботи і гарантую, що наша команда буде робити все для того, щоб будь-якому інвестору, в тому числі і компанії &laquo;HEAD&raquo;, &nbsp;було комфортної у Вінниці вести бізнес і створювати робочі місця&raquo;, - зазначив під час підписання Меморандуму &nbsp;Вінницький міський голова Сергій Моргунов.</span></span></span></span></p>\r\n\r\n<p style="margin-bottom:.0001pt; text-align:justify; margin:0cm 0cm 10pt"><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;"><span style="line-height:150%"><span style="line-height:150%">Голова Вінницької облдержадміністрації Валерій Коровій вважає, що підписання Меморандуму із світовим лідером у виготовленні спортивної амуніції, компанією &laquo;HEAD&raquo;</span><span lang="RU"><span style="line-height:150%">,</span></span><span style="line-height:150%"> а в подальшому будівництво підприємства</span><span lang="RU"><span style="line-height:150%">,</span></span><span style="line-height:150%"> дасть іще один поштовх&nbsp; до розвитку економіки регіону. &laquo;Це один із перших кроків нової стратегії по диверсифікації економічного потенціалу Вінницької області, створення висококваліфікованих робочих місць та високотехнологічних виробництв, яка реалізовується міською радою і облдержадміністрацією. Сьогодні ми фактично відкриваємо нову історичну сторінку розвитку Вінниці і регіону. Тому, хотів би подякувати нашим партнерам по Меморандуму за продуктивно проведену першу фазу перемовин&raquo;, - сказав Валерій Коровій.</span></span></span></span></p>\r\n\r\n<p style="margin-bottom:.0001pt; text-align:justify; margin:0cm 0cm 10pt"><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;"><span style="line-height:150%"><span style="line-height:150%">Головний виконавчий директор компанії &laquo;HEAD&raquo;,</span> <span style="line-height:150%">Йоган Еліаш зазначив: &laquo;Ми відвідали дуже багато країн, шукали найкраще місце, щоб розгорнути виробництво. Хочу сказати, що після такого довгого пошуку ми обрали Вінницю, як найбільш вдале місце для розташування нашого підприємства. Ми бачимо тут великий людський потенціал, вигідне &nbsp;розташування Вінниці і регіону та відчуваємо, що ми тут дійсно дуже бажані гості&raquo;.</span></span></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;"><span style="line-height:150%"><span style="line-height:150%">Ефективну підтримку в організації домовленостей з інвестором щодо реалізації&nbsp; проекту здійснив Офіс із залучення та підтримки інвестицій UkraineInvest.</span></span></span></span></p>\r\n\r\n<p style="margin-bottom:.0001pt; text-align:justify; margin:0cm 0cm 10pt"><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;"><span style="line-height:150%"><span style="background:white"><span style="line-height:150%">&quot;Залучення інвестора, такого масштабу як HEAD, є дуже важливим для України. Це не тільки сприяє створенню виробництва з високою доданою вартістю та робочих місць, а також асоціюватиме Україну з інвестиційно привабливим середовищем для відомих світових брендів &quot;, &ndash; зазначив Директор UkraineInvest Данило Білак. </span></span></span></span></span></p>\r\n\r\n<p style="margin-bottom:.0001pt; text-align:justify; margin:0cm 0cm 10pt"><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;"><span style="line-height:150%"><span style="line-height:150%">У разі успішної реалізації проекту, HEAD&nbsp;розгляне можливість залучення до Вінниці деяких своїх команд у сфері креативних, дослідницьких та інформаційно-комунікаційних технологій, враховуючи, що Вінниця займає шосте місце в Україні за кількістю ІТ-спеціалістів.</span></span></span></span></p>\r\n\r\n<p style="margin-bottom:.0001pt; text-align:justify; margin:0cm 0cm 10pt">&nbsp;</p>\r\n
