4	2	en	2018-08-27 15:17:32.768293	2018-11-02 10:54:43.616788	World leader in the production of sports ammunition "HEAD" intends to invest in Vinnytsia	<p><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">The Austrian company HEAD, which is the most recognizable brand in production of skiing equipment in the world, intends to cooperate with Vinnitsa City Council, the Vinnytsya Regional Administration and the ME &quot;VMTSI&quot; in field of qualified personnel training, job creation in Vinnytsia and development of industrials with high added value.</span></span></p>\r\n	<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">On May 4, 2018, at 13.30 in the White Hall of the Vinnytsia City Council was the signing of the Memorandum of Understanding between HEAD, represented by Johan Eliasch, Vinnytsya Regional State Administration, Vinnytsia City Council and ME &quot;Vinnytsia Municipal Innovation Center&quot; (&quot; VMCI&quot;), with the participation of Director of the Office of Ukraine for the Involvement and Support of Investments, Danylo Bilak.</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">&quot;By signing this memorandum we are making the first step in cooperation with the well-known company &quot;HEAD&quot;. This is a historical moment, and I hope that this cooperation will continue with concrete issues. For my part, as the city mayor and representative of the Vinnytsia team, I acknowledge the gratitude for the beginning of this work and guarantee that our team will do everything to ensure that for any investor, including the company &quot;HEAD&quot;, will be comfortable to conduct business and create jobsi n Vinnitsa&quot;- said during the signing of the Memorandum Vinnytsia City Mayor Serhii Morgunov.</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">The head of Vinnytsia regional administration Valeriy Koroviy believes that the signing of Memorandum with the &quot;HEAD&quot; company, world leader in manufacturing of sports equipment, and further construction of the enterprise, will give one more impetus in development of the region&#39;s economy. &quot;This is one of the first steps of a new strategy in diversify the economic potential of the Vinnytsia region, creation of high skilled jobs and high-tech manufacturing, implemented by the city council and the regional administration. Today we are actually opening a new historical page of development of Vinnytsia and the region. Therefore, I would like to thank our partners for the Memorandum for the productive first phase of negotiations, &quot;said Valeriy Koroviy.</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">Chief Executive Officer of HEAD, Johan Eliash, said: &quot;We visited a lot of countries, looking for the best place to expand production. I want to say that after such a long search, we chose Vinnytsia as the most successful place for our company&#39;s location. We see here a great human potential, a favorable location of Vinnytsia and the region and feel that we are really very welcome guests here.&quot;</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">Effective support in arrangements with the investor on the implementation of the project was carried out by the UkraineInvest investment attraction office.</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">&quot;Involving of such magnitude investor as HEAD is very important for Ukraine, not only contributing to the creation of high-value-added manufacturing and jobs, but also associates Ukraine with an investment-friendly environment for world-known brands,&quot; said UkraineInvest Director Danylo Bilak.</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">In case of a successful implementation of the project, HEAD will consider the possibility of involving some of its teams in field of creative, research and information and communication technologies in Vinnitsa, taking into account that Vinnytsia is the sixth largest in Ukraine by number of IT specialists.</span></span></p>\r\n
2	1	en	2018-08-20 08:04:38.939901	2018-11-28 22:48:06.752478	In Vinnitsa was signed an agreement on the establishment and operation of an industrial park	<p><span style="font-family:ProximaNova-Light;"><span style="font-size:16px;">Today, on August 27, an agreement on the creation and operation of the industrial park &quot;Vinnitsa cluster of refrigeration engineering&quot; was signed in the premises of the Vinnytsia City Council. The contract was signed between the Vinnytsia City Council, the private joint stock company &quot;Ukrainian Beer Company&quot; and the Limited Liability Company &quot;Industrial and Investment Company&quot;.</span></span></p>\r\n	<div>\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">The factory for the production of refrigeration equipment is the first company to work in the industrial park &quot;Vinnitsa cluster of refrigeration engineering&quot;. Production has already begun in test mode and 250 employees have been involved. The enterprise will be put into operation in early September. By the end of 2018 it is planned to create up to 750 more jobs. The planned volume of sales of products (the first queue) is 400 million UAH / year, after the implementation of the II queue (the estimated period 2019-2020) - 700 million UAH / year and additionally 1000 jobs.</span></span></p>\r\n\r\n<p><br />\r\n<span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">&quot;Today is a historic event for the city of Vinnytsia and for the development of industry in the city. In fact, after signing this agreement, we fully create a cluster of refrigeration equipment directly in Vinnitsa. Talking about goals and objectives, I think that this is the first such starting point for the development and adjustment of industrial capacities and capacities in our city. In early September, the first stage of the UBC Group&#39;s refrigeration plant starts operations. The cluster of refrigeration equipment itself is the area where all the contiguous enterprises, which will be made by the refrigeration association, will be united. It is important that new jobs are created, this is an investment attractiveness for our entire city. This is such a good sign that investors can go to the city of Vinnytsia, and can work here. And I hope that it will be an impetus for economic activity in the city. It is also important that attracting any investment is a development of the territory in different directions. The first is the training of skilled personnel. Speaking on the example of vocational education, it is clear that the specialists who could work on the equipment that is available at this plant, there are so few specialists. That is, it will improve the quality of education. Next we are talking about creating jobs, it&#39;s clear that these are the corresponding wages. When some kind of production develops - infrastructure and other enterprises develop near it. Increasing investment attractiveness. This is the activity of the city as a whole. The more we will create jobs, perhaps, this activity will be better &quot;- said the mayor Sergei Morgunov during the signing of the contract.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">The plant has already begun working in the test mode. Employees are trained by specialists from other countries. In early September, the official opening of the first stage of the new plant is planned. The implementation of the project involves the involvement of partners of the refrigeration plant, namely the suppliers of components for heat-exchange equipment, evaporators and condensers, compressors and control systems, which will result in the creation of a complete complex of refrigeration equipment in the industrial park. The controlling company on a competitive basis has been defined by LLC &quot;Industrial-investment company&quot;.</span></span></p>\r\n\r\n<p><br />\r\n<span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">&quot;Today&#39;s event is the realization that we are implementing a program of such a strategic partnership between business, state and society. The main thing for our business, because we are an international company, is the trust of people. The challenge facing us now is the labor migration of people to Europe. If there is no trust, the jobs will be, but the question arises who will take them. An industrial park - this should be an example of the fact that you can work the business on the international standards here in Vinnitsa. I am quite confident that our Western partners are now very interested. And they will also be consistent, and are confident that they will invest in Vinnytsia. We decided to build the plant four years ago, and when determined, we compared the 25 factors. Among these, the qualification of people, which is very important for us, as well as the support of local authorities, which in Vinnytsia is an example of cooperation between business and government, should be the case. The range of wages in our company will be higher than the market. We play in the world&#39;s highest league. It is important for us that our customers have the benefits of our business. If we work with Pepsi, this is about 30-40 countries of operations, then for them the main thing is to comply with their requirements. We are &quot;playing&quot; with companies from Germany, Turkey, Spain. We must create conditions where people will develop their competence and experience, and have such a level of wages and conditions that people would stay here in Vinnitsa and not go to Poland or Romania, &quot;said the director of PJSC Ukrainian Beer company &quot;Igor Burdylenko</span></span></p>\r\n\r\n<p><br />\r\n<span style="font-size:16px;"><span style="font-family:ProximaNova-Light;"><strong>Certificate:</strong><br />\r\nUBC Group is one of the largest manufacturers of industrial refrigeration equipment in Eastern Europe. The company has been operating for over 20 years and has been supplying products to 120 countries. Among its customers are such well-known brands as Coca-Cola, Pepsi, Carlsberg, Heineken, ABInBev, SABMiller, MolsonCoors, Nestl&eacute;.</span></span></p>\r\n\r\n<p><br />\r\n<span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">In July 2018, an open tender was held to select the management company of the industrial park &quot;Vinnitsa cluster of refrigeration engineering&quot;. The investment and investment company Ltd. (Kharkiv) was chosen as the winner of the competition.The factory for the production of refrigeration equipment is the first company to work in the industrial park &quot;Vinnitsa cluster of refrigeration engineering&quot;.</span></span></p>\r\n\r\n<p><br />\r\n<span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">According to preliminary calculations in 2019, budget revenues from the industrial park will amount to UAH 11.2 million from the payment of a single social contribution and UAH 10.5 million from the payment of personal income tax, and in 2024 - UAH 56.1 million and UAH 45.9 million respectively .</span></span></p>\r\n\r\n<p><br />\r\n<span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">The initiators of the creation of the industrial park were: Vinnytsya City Council in the part of the land plot area of ​​8.4176 hectares and PJSC Ukrainian Beer Company (UBC Group) - in the part of the land plot area - 10.85 hectares.</span></span></p>\r\n</div>\r\n
5	3	uk	2018-08-31 16:12:18.706184	2018-12-04 13:07:33.378659	У Вінниці відбувся VI Міжнародний інвестиційний форум "Вінниччина – бізнес в центрі України"	<p><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">7 вересня 2018 року у Вінниці&nbsp;відбувся вже шостий Міжнародний інвестиційний форум &quot;Вінниччина &ndash; бізнес в центрі України&quot;.</span></span></p>\r\n	<div>У Вінниці в п&rsquo;ятницю відбувся VI Міжнародний інвестиційний форум &laquo;Вінниччина &ndash; бізнес в центрі України&raquo;. Участь у заході взяли понад 150 іноземних делегацій.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<blockquote>\r\n<div><em>Міжнародний інвестиційний форум &laquo;Вінниччина &ndash; бізнес в центрі України&raquo; проводиться вже вшосте, і його основною метою є активізація економічної співпраці підприємств регіону та потенційних інвесторів. Він покликаний презентувати інвестиційний, економічний, агропромисловий та туристичний потенціал міста Вінниці та Вінницької області, а відтак, сприяти встановленню нових партнерських контактів та налагодженню взаємовигідного співробітництва.&nbsp;</em></div>\r\n</blockquote>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Щорічно участь у заході беруть вітчизняні урядовці, представники дипломатичного корпусу іноземних держав, інвестиційні компанії, міжнародні експерти, представники бізнес-місій з регіонів-партнерів та ділових кіл, загалом,&nbsp; близько 450 делегатів.&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Програмою форуму VI Міжнародного інвестиційного форуму &laquo;Вінниччина &ndash; бізнес в центрі України&raquo; передбачені пленарне засідання, платформи ділового спілкування та три панельні дискусії. А саме, &laquo;Посилення регіональної конкурентоспроможності: інвестиції, інновації, технології&raquo;, &laquo;Інвестиції в інфраструктуру &ndash; шлях до економічного розвитку територій&raquo; і&nbsp; &laquo;Енергоефективість та енергоощадність &ndash; шлях до енергетичної децентралізації&raquo;.</div>\r\n\r\n<p>&nbsp;</p>\r\n
8	4	en	2018-10-31 14:23:49.757097	2018-11-28 22:55:32.928834	The investment potential of Vinnytsia was presented to one of the most famous business associations in the world	<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">On October 30, 2018, the American Chamber of Commerce in Ukraine presented the investment potential of the city of Vinnytsia in the &quot;City of Contents&quot; hub. Also guests of the Vinnytsia: Invest &amp; Win event were: Horizon Capital Chief Executive Officer Elena Kosharna, former economist and founder of Proriv.ua Workshop Pavel Sheremeta, Deputy Director of UkraineInvest Ulyana Khromiak, and representatives of Vinnytsya and foreign companies.</span></span></p>\r\n	<div>\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">On October 30, 2018, the American Chamber of Commerce in Ukraine presented the investment potential of the city of Vinnytsia in the &quot;City of Contents&quot; hub. Also guests of the Vinnytsia: Invest &amp; Win event were: Horizon Capital Chief Executive Officer Elena Kosharna, former economist and founder of Proriv.ua Workshop Pavel Sheremeta, Deputy Director of UkraineInvest Ulyana Khromiak, and representatives of Vinnytsya and foreign companies.</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">The meeting was started by Sergey Morgunov. He noted that economic growth is important for the development of the city. It is thanks to this that jobs are created, a certain resource is accumulated, activity increases, construction is revitalized. Therefore, the city team is interested in organizing high-quality support of potential investors and close cooperation with business.</span></span></p>\r\n\r\n<p><br />\r\n<span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">&quot;If we talk about the transparency of doing business in the city, then this year we took the first place in the Regional Doing Business 2018 rating. It is a responsibility for us, because in the course of the year we have taken a series of steps to get up this one. We also have a positive rating of investment attractiveness. As for ratings, they stimulate us to develop. But without dialogue with the business - this can not happen. And I am pleased to see at this meeting the Vinnytsia businessmen who are actively developing their companies &quot;, - says the mayor Sergey Morgunov.</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">Andrei Gunder, President of the American Chamber of Commerce in Ukraine, said that he had heard a lot about Vinnytsia. And the business values ​​the steps of local authority in creating a comfortable environment.</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">&quot;The American Chamber of Commerce unites more than 600 companies and partners that invest in Ukraine. About 30% are US companies, the rest are large international investment companies that provide jobs and pay taxes. For 26 years, the American Chamber of Commerce has been monitoring the development of business, which conditions for doing business in Ukraine. And with confidence, I can say that over the past four years, the relationship between business and government is the best dialogue that was for a quarter of a century. We now see that companies are increasingly looking at Ukraine as their investment direction. 83% of companies operating in Ukraine see business growth in 2018 and will continue. I think the investors will continue to work. We hear a lot about Vinnytsa&#39;s positive news, and I think that it will be appreciated by investors, and our task is to inform them that there is a possibility to develop business in Vinnytsia, &quot;Andriy Hunder said.</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">Participants in the presentation have repeatedly spoken about the trust between business and government, which are being developed, including through an open dialogue on similar events.</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="font-family:ProximaNova-Light;">You can see the presentation at the link.</span></span></p>\r\n</div>\r\n
15	8	uk	2019-02-13 07:04:17.691169	2019-02-13 07:08:09.535688	Проекти Вінниці презентували на Міжнародному ЕКСПО-конгресі	<div>\r\n<p>Команда Вінницької міської ради взяла участь у Міжнародному ЕКСПО-конгресі &laquo;Бізнес для Розумних Міст&raquo;. Близько 140 спікерів та 4000 учасників з України та світу ділилися досвідом перетворення міст у сталі та розумні, а також налагоджували партнерські відносини між містами та бізнесом.</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n	<p>Команда Вінницької міської ради взяла участь у Міжнародному ЕКСПО-конгресі &laquo;Бізнес для Розумних Міст&raquo;. Близько 140 спікерів та 4000 учасників з України та світу ділилися досвідом перетворення міст у сталі та розумні, а також налагоджували партнерські відносини між містами та бізнесом.</p>\r\n\r\n<p>Під час заходу презентували досягнення міста в розвитку інноваційного середовища та стимулювання малого та середнього підприємництва. Заступник вінницького міського&nbsp;голови Владислав Скальський розповів про впровадження Концепції інтегрованого розвитку м. Вінниці 2030 - документу цілісного розвитку міста на 10 років, детально зупинившись на візії &laquo;Конкурентоспроможне українське місто на мапі Східної Європи&raquo;.</p>\r\n\r\n<div>\r\n<p>Ця візія передбачає реалізацію 11 стратегічних проектів, серед яких hard &amp; soft проекти, зокрема:</p>\r\n\r\n<ul>\r\n\t<li>перегляд місцевого регуляторного середовища та розвиток відкритої регуляторної платформи &ndash; як soft проекти;</li>\r\n\t<li>створення Інноваційно-технологічного парку &laquo;Кристал&raquo; - hard проект, стратегічний для міста.</li>\r\n</ul>\r\n\r\n<p>Також, розповідали про досвід розбудови системи smart-city, зокрема результати роботи &laquo;Ситуаційного центру&raquo;, основна мета якого - безпека вінничан та гостей міста.</p>\r\n\r\n<p>До складу делегації від Вінниці увійшли представники місцевого бізнесу &ndash; ІТ-компанії &laquo;Gemicle&raquo; та &laquo;IncoreSoft&raquo;, які презентували рішення для системи smart-city.</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n
