13	7	uk	2018-11-30 15:17:57.412057	2018-11-30 15:44:13.291976	Вінниця підвищила позиції та посіла перше місце у Рейтингу прозорості інвестиційного сектору	<div>Вінниця перемістилась вгору на три сходинки та розділила перше місце з Івано-Франківськом здобувши 15 балів. Міжнародна антикорупційна організація Transparency International опублікувала доопрацьовані результати дослідження щодо прозорості інвестиційного сектору міст України, який було опубліковано на початку жовтня.<br />\r\n&nbsp;</div>\r\n	<div>Ще у вересні Вінниця посідала третє місце з сотні міст у рейтингу, який відображає рівень прозорості інвестицій в Україні за міжнародною оцінкою. Завдяки тому, що місто виявилось не байдужим та оперативно зреагувало на поради щодо підвищення інвестиційної привабливості міста, вже сьогодні Вінниця посідає першу сходинку.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<blockquote>\r\n<div>&laquo;Вінниця &ndash; місто, яке першопочатково показало високі результатами у Рейтингу прозорості інвестиційного сектору. Місто займало 3 місце та мало 12 балів з 20. Наразі Вінниця має 15 балів і таким чином, переміщається на першу сходинку Рейтингу, розділивши її з містом Івано-Франківськ, яке також має 15 балів&raquo;, - повідомили в організації<strong> Transparency International</strong>.</div>\r\n</blockquote>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;<img alt="" src="/uploads/ckeditor/pictures/50/content_1.png" style="width: 800px; height: 618px;" /></div>\r\n\r\n<div><br />\r\n<br />\r\nГоловною метою дослідження є підвищення рівня антикорупційної практики та прозорості на рівні міста в інвестиційній сфері. Сталий розвиток міст є одним із ключових інструментів стрімкого економічного розвитку держави. А без прозорості та високої спроможності міст у сфері інвестицій, розвиток підприємства у громадах неможливий.</div>\r\n\r\n<div><br />\r\nДослідженням &laquo;Рейтинг прозорості інвестиційного сектору 100 міст України&raquo; Transparency International в рамках Програми &laquo;Transparent Cities/Прозорі міста&raquo; допомагають муніципальним управлінцям, потенційним інвесторам, підприємцям оцінити рівень прозорості в інвестиційній сфері найбільших 100 міст в Україні.</div>\r\n\r\n<blockquote>\r\n<div><br />\r\n&nbsp;&laquo;Високий рівень інвестиційної діяльності Вінниці є одним з ключових завдань усієї команди Вінницької міської ради, яку очолює міський голова Сергій Моргунов. Місто демонструє значні успіхи у цьому напрямку, про це свідчать не лише високі позиції міста у всеукраїнських та міжнародних рейтингах, а й говорять інвестори, які вже працюють &nbsp;у Вінниці. Щодо рейтингу Transparency International, то нам вдалось підвищити позиції врахувавши рекомендації експертів, які ми отримали під час попередньої оцінки. Роботи щодо вдосконалення тривають надалі, наша мета не лише здобути першість, а дійсно бути містом-лідером для інвестування та відповідати світовим стандартам інвестування&raquo;, - розповів директор департаменту економіки та інвестицій <strong>Віталій Погосян</strong>.</div>\r\n</blockquote>\r\n\r\n<div><img alt="" src="/uploads/ckeditor/pictures/51/content_2.png" style="width: 800px; height: 618px;" /></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>За результатами роботи над покращенням ситуації з прозорістю інвестиційного сектору, Вінниця виконала ряд рекомендацій. А саме <strong><a href="https://u.to/JMUyFA">оприлюднені</a></strong> контакти&nbsp;членів виконавчого комітету, в тому числі підприємців, місто <strong><a href="https://u.to/ZcUyFA">підключене</a></strong> до платформи, яка допомагає людям відкрити власний бізнес , <strong><a href="https://u.to/o8UyFA">оприлюднено інформацію</a></strong> про інженерні мережі на об&#39;єктах/проектах, які пропонуються міською владою не залежно від форми власності для інвестицій у форматі зручної карти.</div>\r\n\r\n<div><br />\r\nНагадаємо, у листопаді 2017 року рішенням Вінницької міської ради у місті затверджено Програму сприяння залучення інвестицій у м. Вінницю, яка працює на підсилення цілей визначених у Стратегії розвитку &laquo;Вінниця-2020&raquo;.</div>\r\n
7	4	uk	2018-10-31 14:23:49.75495	2018-12-11 13:58:29.561879	Інвестиційний потенціал Вінниці презентували одній з найвідоміших бізнес-асоціацій в світі	<div>30 жовтня 2018 року у хабі &quot;Місто змістів&quot;&nbsp;Американській торговельній палаті в Україні&nbsp; презентували інвестиційний потенціал міста Вінниця.&nbsp;Також гостями заходу&nbsp;&laquo;Vinnytsia: Invest &amp; Win&raquo; стали: головний виконавчий директор&nbsp;Horizon Capital&nbsp;Олена Кошарна, екс-міністр економіки та засновник майстерні &laquo;Proriv.ua&raquo; Павло Шеремета, заступник директора&nbsp;UkraineInvest&nbsp; Уляна Хром&#39;як, та представники вінницьких та іноземних підприємств.</div>\r\n\r\n<div>&nbsp;</div>\r\n	<div>\r\n<div>30 жовтня 2018 року у хабі &quot;Місто змістів&quot;&nbsp;Американській торговельній палаті в Україні&nbsp; презентували інвестиційний потенціал міста Вінниця.&nbsp;Також гостями заходу&nbsp;&laquo;Vinnytsia: Invest &amp; Win&raquo; стали: головний виконавчий директор&nbsp;Horizon Capital&nbsp;Олена Кошарна, екс-міністр економіки та засновник майстерні &laquo;Proriv.ua&raquo; Павло Шеремета, заступник директора&nbsp;UkraineInvest&nbsp; Уляна Хром&#39;як, та представники вінницьких та іноземних підприємств.</div>\r\n</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Зустріч розпочав Сергій Моргунов. Він зазначив, що для розвитку міста важливим є економічне зростання. Саме завдяки цьому створюються робочі місця, накопичується певний ресурс, зростають активності, пожвавлюється будівництво. Тому міська команда зацікавлена в організації якісного супроводження потенційних інвесторів та тісній співпраці з бізнесом.</div>\r\n\r\n<div>&nbsp;\r\n<div>&nbsp;</div>\r\n\r\n<div>\r\n<blockquote>\r\n<div>&laquo;Якщо говорити про прозорість ведення бізнесу в місті, то в цьому році ми зайняли перше місце у рейтингу Regional Doing Business 2018. Для нас це відповідальність, тому що ми за рік зробили ряд заходів, щоб піднятись на цю сходинку. Маємо також позитивний рейтинг інвестиційної привабливості. Щодо рейтингів, то вони стимулюють нас до розвитку. Але без діалогу з бізнесом &ndash; &nbsp;це не може відбуватись. І мені приємно бачити на цій зустрічі вінницьких бізнесменів, які активно розвивають свої компанії&raquo;, - каже міський голова Сергій Моргунов.</div>\r\n</blockquote>\r\n<iframe allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen="" frameborder="0" height="315" src="https://www.youtube.com/embed/QXuOxI6vcvI?start=408" style="margin-right: 5px;" width="550"></iframe><iframe allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen="" frameborder="0" height="315" src="https://www.youtube.com/embed/YnVY6F15_bw" width="550"></iframe>\r\n\r\n<div>Президент Американської торговельної палати в Україні Андрій Гундер зазначив, що багато чув про Вінницю позитивного. І бізнес цінує кроки локальної влади щодо створення комфортного середовища.&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<blockquote>\r\n<div>&laquo;Американська торговельна палата об&rsquo;єднує понад 600 компаній і партнерів, які інвестують &nbsp;в Україні. &nbsp;Близько 30% - це американські компанії, решта - це великі міжнародні компанії, які інвестують, які надають робочі місця і платять податки. Вже 26 років Американська палата спостерігає, як розвивається бізнес, які умови для ведення бізнесу в Україні. І з впевненістю можу сказати, що за останні чотири роки стосунки між бізнесом і владою &ndash; найкращий діалог який був за чверть століття. Ми зараз бачимо, що компанії все більше дивляться на Україну як на напрямок їх інвестицій. 83% компаній, які працюють в Україні, бачать ріст бізнесу у 2018 році, і він буде продовжуватися. &nbsp;Думаю інвестори і далі будуть продовжувати працювати. Ми багато чуємо про Вінницю позитивів, і думаю, що це оцінять інвестори, а наше завдання - доносити до них, що є можливість розвивати бізнес &nbsp;у Вінниці&raquo;, - розповів&nbsp; Андрій Гундер.</div>\r\n</blockquote>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Учасники презентації неодноразово говорили про довіру між бізнесом та владою, які напрацьвуються, в&nbsp;тому числі, завдяки відкритому діалогу на подібних заходах.</div>\r\n\r\n<div>&nbsp;</div>\r\nОзнайомитись з презентацією можна&nbsp;<strong><a href="https://issuu.com/deii.vmr/docs/________________________30_10.pptx" target="_blank">за посиланням</a>.</strong></div>\r\n</div>\r\n
21	11	uk	2019-02-13 07:18:27.76526	2019-02-13 07:18:27.76526	Вінниця отримала «Кришталь року» у одній з номінацій рейтингу бюджетної прозорості українських міст та громад	<div>\r\n<p>29 січня у Києві відбулась перша в Україні церемонія нагородження переможців рейтингу бюджетної прозорості &laquo;Кришталь року&raquo;. У ній взяли участь українські об&rsquo;єднані громади та міста. Вінниця перемогла у номінації &laquo;Найпрозоріше оприлюднення бюджетних даних в машиночитному форматі&raquo;. Такий формат дозволяє автоматизовано обробляти інформацію електронними засобами. Тобто, одним кліком мишки можна відсортувати дані за потрібними категоріями. Машиночитний формат дозволяє проводити якісний аналіз, планування тощо.</p>\r\n</div>\r\n	<article>\r\n<p>&laquo;Кришталь року&raquo; &ndash; &nbsp;перша в Україні нагорода за бюджетну прозорість, яка одночасно показує стан речей в бюджетній сфері та слугує дороговказом, до яких показників і практик прозорості бюджетного процесу варто прямувати. &laquo;Кришталь року&raquo; відзначає найкращі міста та громади, які пройшли оцінювання за міжнародно методологією.</p>\r\n\r\n<p>На церемонію нагородження від Вінниці завітав директор Департаменту економіки і інвестиції Вінницької міської ради Віталій Погосян.</p>\r\n\r\n<p><img alt="" src="/uploads/ckeditor/pictures/63/content_51200830_2025614777546700_2340771792093708288_o.jpg" style="width: 800px; height: 530px;" /></p>\r\n\r\n<blockquote>\r\n<p>&laquo;Бюджетна прозорість та відкритість інформації є важливими принципами роботи у напрямку розвитку демократичного суспільства, яким слідує уся команда Вінницької міської ради на чолі з міським головою Сергієм Моргуновим. Зручність та доступність інформації дають можливість громаді долучатись до її розвитку, побудови дійсно ефективного діалогу та ефективної співпраці&raquo;, &ndash; каже&nbsp;<strong>Віталій Погосян</strong>.&nbsp;</p>\r\n</blockquote>\r\n\r\n<p>Всіх номінантів було оцінено за 34 критеріями. Дана методологія &ndash; це список цілей, які потрібно досягти муніципалітетам, щоб можна було стверджувати, що всі фінансові процеси організовані належним чином. Це картинка майбутнього ідеального управління коштами міст і громад, коли всі етапи бюджетного процесу &ndash; від планування до звітування &ndash; прозорі і зрозумілі для платників податків, які, власне, і наповнюють ці бюджети.</p>\r\n\r\n<p>Організаторами рейтингу виступає консорціум проектів міжнародної технічної допомоги за підтримки Представництва Європейського Союзу, Агентства США з міжнародного розвитку (USAID), Уряду Канади, Фонду &laquo;Східна Європа&raquo;, проекту ПРОМІС та Міжнародного фонду &laquo;Відродження&raquo; та інших.</p>\r\n\r\n<p>Зауважимо, що у даній номінації також змагались Дрогобич, Львів, Ужгород та Чернівці.</p>\r\n</article>\r\n
