COPY public.content_translations (id, content_id, locale, created_at, updated_at, title, description) FROM stdin;
5	3	uk	2018-12-05 10:16:06.866481	2018-12-07 09:08:46.59394	Історичний центр 	<div>Вінниця &mdash; історичний центр Поділля з багатою історією, традиціями, культурою та великою кількістю музеїв. Вінниця є інтеркультурним та толерантним містом, де представлені храми всіх основних релігійних конфесій України: християнських (православні, католики, греко-католики, протестанти), ісламських та юдейських.</div>\r\n
3	2	uk	2018-08-28 13:11:58.985145	2018-12-05 15:34:45.87944	Про нас	<p><strong>Департамент економіки і інвестицій</strong> як структурний підрозділ <strong>Вінницької міської ради</strong> відповідає за економічну та інвестиційну сфери міста. Метою департаменту в межах інвестиційної політики є <strong>пошук, налагодження контактів та всебічна підтримка та супровід інвесторів</strong>. Крім того, департамент розробляє та впроваджує засади інвестиційної політики Вінниці, надає підтримку у реалізації інвестиційних проектів та ініціює створення інноваційної інфраструктури міста.</p>\r\n
4	2	en	2018-08-28 13:11:58.986446	2018-12-10 08:32:38.559076	About Us	<p><strong>The Department of Economics and Investments</strong> as a structural subdivision of the <strong>Vinnytsia City Council</strong> is responsible for the economic and investment spheres of the city. The purpose of the department within the investment policy is to <strong>search, establish contacts and provide comprehensive support and support to investors</strong>. In addition, the department develops and implements the principles of the investment policy of Vinnytsia, provides support for the implementation of investment projects and initiates the creation of an innovative infrastructure of the city.</p>\r\n
2	1	en	2018-08-28 13:11:58.979284	2018-12-20 11:24:23.978597	Interactive investment map	<p>Find out more about free real estate, land plots and projects offered by Vinnytsia. With just one click, you can see the options for collaboration.</p>\r\n
1	1	uk	2018-08-28 13:11:58.977928	2018-12-03 14:01:32.612928	Інтерактивна інвестиційна мапа	<p>Дізнайтесь більше про вільні об&rsquo;єкти нерухомості, земельні ділянки і проекти запропоновані Вінницею. За допомогою всього лише одного кліку ви можете побачити варіанти співпраці.</p>\r\n
23	12	uk	2018-12-27 16:26:47.299207	2018-12-27 16:26:47.299207	Подивитись відео	
9	5	uk	2018-12-05 10:16:06.883024	2018-12-07 08:40:54.405803	Корисна інформація	<table border="1" cellpadding="1" cellspacing="1">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td><strong>$10 - 17</strong></td>\r\n\t\t\t<td>\r\n\t\t\t<div>Середній чек у закладах харчування (на дві персони)</div>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<div><strong>$0,18</strong></div>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<div>Вартість разового проїзду у громадському транспорті</div>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<div><strong>$30</strong></div>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<div>Середня вартість проживання у стандартному номері</div>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<div>&nbsp;</div>\r\n
7	4	uk	2018-12-05 10:16:06.875186	2018-12-05 10:26:32.071033	Цікаві факти	<div>У Вінниці розроблено мобільний туристичний додаток &laquo;Вільна мапа&raquo;, що допомагатиме гостям міста більше дізнаватись про його історію</div>\r\n\r\n<div>У Вінниці знаходиться єдиний в Україні &laquo;Музей української марки ім. Якова Балабана&raquo;</div>\r\n\r\n<div>Вінниця &mdash; перша столиця УНР (Українська Народна Республіка)</div>\r\n\r\n<div>Однією з візитівок Вінниці є Фонтан Roshen &mdash; єдиний в Україні і найбільший в Європі плаваючий фонтан, побудований в руслі річки Південний Буг</div>\r\n\r\n<div>Збільшилась кількість пасажирів, які скористалися послугами аеропорту Вінниця. За 10 місяців 2016 року кількість пасажирів становила 24,545 тис, 2017 року - 48,861 тис, 2018 року - 51,609 тис. Таким чином кількість пасажирів за 2 роки збільшилась удвічі</div>\r\n
6	3	en	2018-12-05 10:16:06.868448	2018-12-07 12:13:00.731201	Historical center	<div>Vinnytsia is a historical centre of Podillya with a rich history, traditions, culture and a large number of museums. Vinnitsa is an intercultural and tolerant city where the churches of all the main religious denominations of Ukraine are presented: Christian (Orthodox, Catholic, Greek Catholic, Protestant), Islamic and Jewish.</div>\r\n
11	6	uk	2018-12-27 16:26:47.265085	2018-12-27 16:26:47.265085	Місто, яке надихає кожного	Наше місто відкрите до змін. Поєднаємо мрії та можливості. Створимо майбутнє разом!
12	6	en	2018-12-27 16:26:47.266363	2018-12-27 16:26:47.266363	City that inspires everyone	Our city is open to change. Combine dreams and opportunities. Let's create the future together!
8	4	en	2018-12-05 10:16:06.87658	2018-12-05 10:40:44.03685	Interesting Facts	<div>Vinnytsya has developed a mobile tourist application &laquo;Free Map&raquo;, which will help the guests of the city to learn more about its history.</div>\r\n\r\n<div>In Vinnytsia is the only one in Ukraine &laquo;Museum of the Ukrainian Brand named after. Jacob Balaban&raquo;</div>\r\n\r\n<div>Vinnytsya is the first capital of Ukrainian People&#39;s Republic</div>\r\n\r\n<div>One of the business cards of Vinnitsa is the Roshen Fountain - the only one in Ukraine and the largest floating fountain in Europe, built in the course of the Southern Bug River</div>\r\n\r\n<div>The number of passengers who took advantage of the services of the airport of Vinnitsa has increased. During 10 months of 2016 the number of passengers was 24,545 thousand, in 2017 - 48,861 thousand, in 2018 - 51,609 thousand.</div>\r\n
10	5	en	2018-12-05 10:16:06.884347	2018-12-05 10:42:15.256183	Useful Information	<table border="1" cellpadding="1" cellspacing="1">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td>$7-12</td>\r\n\t\t\t<td>\r\n\t\t\t<div>Average check at food establishments</div>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<div>$0,18</div>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<div>The cost of one-way fee by public transport</div>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<div>$30</div>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<div>Average cost per stay in standard room</div>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<div>&nbsp;</div>\r\n
