2	1	en	2018-08-20 10:21:22.211687	2018-10-12 14:05:31.598324	About the city	<p style="text-align: center;"><img alt="" src="/uploads/ckeditor/pictures/18/content_%D0%9C%D0%BE%D1%80%D0%B3%D1%83%D0%BD%D0%BE%D0%B2.JPG" /></p>\r\n\r\n<p style="text-align: justify;"><strong><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Dear colleagues,</span></span></strong></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">V</span></span><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">innytsia is a modern city with a dynamically developing economy. The city has well-established industrial traditions, a strong educational base, scientific schools engaged in such areas as IT, engineering, healthcare.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Vinnytsia is characterized by an advantageous geographic location, which is one of its key competitive advantages. During the period of independence, the city&#39;s economy has significantly transformed: there has been a structural shift from machine building, electronic and chemical industries towards the food industry, trade and tertiary sector.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">In recent years, the city authorities have been actively working on attracting investments and developing the industry sector.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">The investment site will be interesting and useful for private investors, representatives of foreign companies, citizens of the city and Ukraine. We invite you to cooperate in the implementation of joint investment initiatives.</span></span></p>\r\n\r\n<p style="text-align: justify;"><strong><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Sincerely,<br />\r\nSerhii Morhunov<br />\r\nMayor of Vinnytsia</span></span></strong><br />\r\n&nbsp;</p>\r\n\r\n<p><span style="color:#c0392b;"><span style="font-size:28px;"><span style="font-family:ProximaNova-Light;">QUICK TIPS ABOUT VINNYTSIA</span></span></span></p>\r\n\r\n<ul>\r\n\t<li><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Year of foundation - 1363</span></span></li>\r\n\t<li><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">The area of the city is 113.2 km2</span></span></li>\r\n\t<li><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Population - 371, 9 thousand people</span></span></li>\r\n\t<li><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">The city budget for 2018 - 4.8&nbsp;billion hryvnias, including the budget for development - 857&nbsp;million hryvnia.</span></span></li>\r\n\t<li><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">The length of the Southern Bug River within the city is -14 km</span></span></li>\r\n\t<li><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Vinnytsia Industrial Park - 60.7 hectares</span></span></li>\r\n\t<li><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">The industrial park &quot;Vinnitsa cluster of refrigeration engineering&quot; - 19,27 hectares</span></span></li>\r\n\t<li><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Three times recognized as the best city for life</span></span></li>\r\n\t<li><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">No. 1 in the &quot;Index of Satisfaction with Quality of Spheres and Services&quot; 2017, 2018 All-Ukrainian Municipal Survey</span></span></li>\r\n\t<li><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">European Energy Award</span></span></li>\r\n\t<li><span style=