1	1	uk	2018-08-20 10:21:22.201205	2018-10-12 14:06:21.849574	Про місто	<p style="text-align: center;"><img alt="" src="/uploads/ckeditor/pictures/17/content_%D0%9C%D0%BE%D1%80%D0%B3%D1%83%D0%BD%D0%BE%D0%B2.JPG" /></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;"><strong>Шановні колеги</strong>,</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Вінниця - сучасне місто, економіка якого динамічно розвивається. Місто має тривалі промислові традиції. потужну освітню базу наукові школи, які працюють у сфері інформаційних технологій, інженерії, медицини.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Вінниця характеризується вигідним георграфічним розташуванням, що є його однією з ключових конкрентних переваг. За період незалежності, економіка міста суттєво трансформувалась: відбувся структурний зсув від галузей машинобудування, електронної та хімічної промисловості в бік харчової промисловості, торгівлі та сфери послуг.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Протягом останніх років міська влада активно працює над залученням інвестицій та рощвитком промислового сектору.&nbsp;</span></span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Інформація на інвестиційнму порталі міста буде цікава та корисна приватним інвесторам, представникам іноземних компаній, громадянам міста і України. Запрошуємо до співпраці у реалізації спільних інвестиційних ініціатив.</span></span></p>\r\n\r\n<p><strong><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">З повагою, Міський голова</span></span></strong></p>\r\n\r\n<p><strong><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Сергій Моргунов</span></span></strong></p>\r\n\r\n<img alt="" src="/uploads/ckeditor/pictures/29/content_%D1%80%D0%B5%D0%B7%D1%8E%D0%BC%D0%B5.png" style="width: 594px; height: 800px;" />\r\n
\.
