х робочих місць.</span></li>\r\n\t\t\t\t<li><span style="font-size:16px;">Осучаснення та трансформації освітніх послуг, за рахунок створення майданчику та матеріальної бази для наукових досліджень та спільних проектів.</span></li>\r\n\t\t\t</ul>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td colspan="2">\r\n\t\t\t<div><span style="font-size:16px;"><b>Потреби в інвестиціях</b></span></div>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<div><span style="font-size:16px;"><b>Сума та тип</b></span></div>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<div><span style="font-size:16px;">200 млн. грн.</span></div>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<div><span style="font-size:16px;"><b>Термін реалізації проекту</b></span></div>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<div><span style="font-size:16px;">18 місяців.</span></div>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<div><span style="font-size:16px;"><b>Період окупності </b></span></div>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<div><span style="font-size:16px;">13 років.</span></div>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<div><span style="font-size:16px;"><b>Очікувана готовність проектної документації</b></span></div>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<div><span style="font-size:16px;">версень 2018 року.</span></div>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td colspan="2">\r\n\t\t\t<div><span style="font-size:16px;"><b>Розміщення та інфраструктура</b></span></div>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<div><span style="font-size:16px;"><b>Розміщення </b></span></div>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<div><span style="font-size:16px;">м. Вінниця, вул. 600-річчя, 21.</span></div>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<div><span style="font-size:16px;"><b>Інфраструктура</b></span></div>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<div><span style="font-size:16px;">Будівля промислово