2	1	en	2018-09-04 06:43:07.319958	2018-10-31 10:08:51.477001	Humennyi 	Ihor		Founder and president of UBC Group	<p><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Among the Ukrainian cities, Vinnytsia is the most approximated to European standards. In 2014, when we were searching for a location for a new company, we visited Lviv, Lutsk, Zhytomyr and Cherkassy. When we ariived with an investment proposal to Vinnytsia, Mayor Sergei Morgunov and Valeriy Koroviy who was his deputy then did not leave us a chance. We received maximum assistance, from buying land to resolving all formalities. The local authorities made all efforts to make us choose Vinnytsya. Now we have launched the first line of production. We need to notice that Vinnytsia people are hard-working and open. My hometown is Dyakivtsi, Litinsky district. We have a lot of plans, among them to develop our Vinnitsa enterprise.</span></span></p>\r\n
4	2	en	2018-09-05 08:39:08.46761	2018-11-01 15:35:39.412604	Tyshchenko	Oleksandr		Executive director of Delphi	<p style="text-align: justify;"><span style="font-family:ProximaNova-Light;"><span style="font-size:18px;"><span style="line-height:107%"><span style="line-height:107%">Delphi has chosen Vinnytsia from ten locations for doing business in Ukraine. Vinnytsia people are positive and persistent. We noticed it and it was also noticed by all investors of the city. Young people come to work as ordinary employees, and in a year or two become leaders and manage a team of 200-300 people. They have a thirst for life and for development. Vinnytsia is a bright and friendly city with beautifully streets, modern and convenient city transport, and a lot of host facilities. In winter, snow is beeng removed from the roads and sidewalks even at night, so everything is always clean in the morning. This is a sign that local authorities are really concerned about citizens. This is a European approach to city management.</span></span></span></span></p>\r\n
14	7	en	2018-11-01 15:16:55.805698	2019-03-06 13:19:25.364802	Hunder 	Andriy		President at American Chamber of Commerce in Ukraine	<div><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Vinnytsia is a really wonderful example of attracting investments. The main thing for it is building of communication and trust. We can see it regarding on examles of companies who already work here. If we will ask them why they are here, they will answer that it&#39;s because everything is super, it gives confidence that other companies can go to the city. I think it&#39;s really important to show and o tell them on the examples, because it&#39;s always better to see, and not listen to promises. Therefore, I think that Vinnytsia is on the right way now and I also think that after today&#39;s event, we will communicate with these messages to other investors and companies. I&#39;m really very impressed with what I&#39;ve seen today.</span></span></div>\r\n
12	6	en	2018-09-06 06:41:56.513162	2018-10-31 09:36:18.684698	Ponomarchuk 	Viktor		Founder and chairman of the board of directors of the industrial group ViOil	<p><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Our company began to work at 90&#39;s. Vioil was the first in Ukraine who began to produce rapeseed oil. Today we are the world leader in production of sunflower oil and export it to dozens of countries around the world. I believed in this business from the start and I was sure, in my choice, to build it in Vinnytsia. There was and it is still maintenance of city autorities and economic security here. And also it is special energy in Vinnytsia people. Our employees, with their knowledge and willingness to work, are not inferior to specialists from other countries of the world, and in terms of flexibility and adaptation to situations they are even ahead. The enterprise develops and continues to increase its own capacity. In view of decentralization, it is nice to see that taxes that go to the city budget are spent on the development of infrastructure and the urban environment. The comfort of the city&#39;s citizens, including our employees, is constantly rising.</span></span></p>\r\n
10	5	en	2018-09-06 06:30:33.663218	2018-10-31 10:02:23.627701	Myslyvyi	Petro		General Director of Agrana Fruit	<p><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">AGRANA FRUT LTD Ukraine has been operating in fertile lands of Vinnytsia for more than 20 years. The main areas of activity of the enterprise are: processing of fruits and vegetables, production of frozen, aseptic products and fruit fillers. Located in the center of Ukraine, Vinnytsia is well suited for the company&#39;s business, since almost all traditional Ukrainian cultures are grown in the region, and road delivery is easy. Over the years Agrana Fruit Ukraine has established effective mutually beneficial partnerships with local farmers and cooperative farms, and the progressive leadership of the city and region creates comfortable conditions for work and development and always paying attention to business needs. The city where we work is rapidly developing, is very creative and comfortable, so everything that we do here brings pleasure and joy.</span></span></p>\r\n
9	5	uk	2018-09-06 06:30:33.661409	2018-10-31 10:02:23.626539	Мисливий	Петро		Генеральний директор Agrana Fruit	<p style="margin: 0cm 0cm 8pt; text-align: justify;"><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;"><span style="line-height:107%">ТОВ АГРАНА ФРУТ Україна вже понад 20 років працює на благодатних теренах Вінниці. Основними напрямками діяльності підприємства є: переробка фруктів та овочів, виробництво замороженої, асептичної продукції та фруктових наповнювачів. Розташована у центрі України, Вінниця чудово підходить для діяльності компанії адже майже всі традиційні українські культури вирощуються в регіоні, а доставка продукції автомобільними шляхами не обтяжується складнощами. За роки діяльності Аграна Фрут Україна налагодила ефективні взаємовигідні партнерські стосунки з місцевими фермерами та кооперативними господарствами, а прогресивне керівництво міста та області створюють комфортні умови для праці та розвитку, завжди звертаючи увагу на потреби бізнесу. Місто, де ми працюємо стрімко розвивається, є дуже креативним та комфортним, тому все, що ми робимо тут приносить задоволення та радість.&nbsp; &nbsp;</span></span></span></p>\r\n
1	1	uk	2018-09-04 06:43:07.318397	2018-10-31 10:08:51.475866	Гуменний	Ігор		Засновник та президент UBC Group	<p style="text-align: justify;"><span style="font-family:ProximaNova-Light;"><span style="font-size:18px;">Серед українських міст Вінниця &ndash; найбільш наближена до Європейських стандартів. У 2014 році, коли ми шукали локацію для нового&nbsp;підприємства,&nbsp;відвідали Львів, Луцьк, Житомир та Черкаси. Приїхавши&nbsp;з інвестиційною пропозицією до Вінниці міс<span style="text-align: justify;">ький голова Сергій Моргунов і його тодішній заступник Валерій Коровій не залишили нам шансів. Ми отримали&nbsp;максимальне сприяння, починаючи від купівлі землі до вирішення всіх формальностей.&nbsp;Місцева влада доклала максимальних зусиль, аби ми обрали Вінницю. Нині ми&nbsp;</span><span style="line-height:107%"><span style="line-height:107%">запустили першу чергу виробництва.</span></span><span style="text-align: justify;">&nbsp;Варто відзначити, що в</span><span style="line-height:107%"><span style="line-height:107%">інничани працьовиті й&nbsp;відкриті. Я сам родом з с. Дяківці, Літинського р-ну. Ми маємо чимало планів, серед них&nbsp;розвивати наше Вінницьке підприємство. </span></span></span></span></p>\r\n\r\n<p style="text-align: justify;">&nbsp;</p>\r\n
13	7	uk	2018-11-01 15:16:55.804159	2018-11-01 15:16:55.804159	Гундер	Андрій		Президент Американської торговельної палати в Україні	<div><span style="font-size:18px;"><span style="font-family:ProximaNova-Light;">Вінниця &ndash; це дійсно прекрасний приклад того, як запрацювала інвестиційна привабливість. Головне &ndash; це комунікація та побудова довіри. Це можна бачити на конкретних прикладах, які компанії вже працюють тут. Якщо їх запитати як їм тут, а вони скажуть, що все супер, тоді це дає довіру, що можна й іншим компаніям заходити. Думаю, дійсно важливо на прикладах показувати, розказувати, тому що дійсно краще побачити раз, ніж слухати обіцянки. Тому, я думаю, що Вінниця зараз на правильному шляху і гадаю, що після сьогоднішньої події ми будемо доносити ці меседжі іншим інвесторам та компаніям. Я дійсно дуже приємно вражений тим, що сьогодні бачу.</span></span></div>\r\n
11	6	uk	2018-09-06 06:41:56.511295	2018-10-31 09:36:18.68293	Пономарчук	Віктор		Засновник і голова ради директорів промислової групи ViОil	<p style="text-align: justify;"><span style="font-family:ProximaNova-Light;"><span style="font-size:18px;">Наше підприємство почало працювати ще на початку 90-х років. Vioil першим в Україні розпочало виробляти рапсову олію.&nbsp;Нині ми є світовим лідером з виробництва соняшникової олії та експортуємо її в десятки країн світу.&nbsp;Я вірив в цей бізнес і був впевнений, у своєму виборі побудувати його саме у Вінниці. Тут була і є&nbsp;підтримка влади та економічна безпека.&nbsp; А у вінничан особлива енергетика. Наші працівники по знаннях та бажанню працювати не поступаються спеціалістам з інших країн світу, а по гнучкості та адаптації до ситуацій, навпаки випереджають їх. Підприємство розвивається та продовжує збільшувати власну потужність. З урахуванням децентралізації, приємно бачити, що податки, які йдуть в міську казну витрачаються саме на розвиток інфраструктури та міського середовища. Комфорт громадян міста, серед яких наші співробітники, постійно підвищується.</span></span></p>\r\n
3	2	uk	2018-09-05 08:39:08.465256	2018-11-01 15:40:44.661754	Тищенко	Олександр		Виконавчий директор Delphi	<p style="text-align: justify;"><span style="font-family:ProximaNova-Light;"><span style="font-size:18px;"><span style="line-height:107%"><span style="line-height:107%">У компанії Delphi розглядали десять локацій для ведення бізнесу в Україні. Серед усіх обрали Вінницю. При першій зустрічі міського голови Сергія Моргунова та очільника облдержадміністрації Валерія Коровія вони виступили єдиним фронтом, єдиною командою і дуже вигідно &laquo;продали&raquo; регіон&raquo;. Вінничани - &nbsp;позитивні та наполегливі. Це одразу помітно і відзначають усі інвестори міста. Молодь приходить працювати звичайними працівниками, а за рік-два стають лідерами та керують командою у 200-300 людей. У них є жага до життя та розвитку. Вінниця &nbsp;- світле та привітне місто, з гарно освітленими вулицями, сучасним та зручним міським транспортом та безліччю закладів для розваг та харчування. Взимку, сніг на дорогах та тротуарах прибирають навіть вночі, аби до ранку все було чисто. Це знак того, що місцева влада дійсно турбується про громадян. Це європейський підхід до управління містом.</span></span></span></span></p>\r\n
\.
