4	2	en	2018-11-29 11:02:47.025042	2019-03-06 12:11:14.963078	Food Industry	<div>\r\n<p><span style="font-size:20px;">Due to a favorable location in the center of a large agricultural region, Vinnytsia is an important region for the food industry.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Food production&nbsp;that meets world quality standards was determined as the main &quot;smart&quot; specialization of the city. This industry accounts&nbsp;up to 50% of the city total industrial production.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">The volume of sales related to the food industry&nbsp;for January-September period amounted to 11 439 401 UAH, which represents 52,1% of the total sales in the city.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Vinnytsia region is a leader in cultivation of many types of agricultural crops&nbsp;and one of the most favorable regions for the cultivation of agricultural products. The level of agricultural land-plowing&nbsp;development in the region is 76.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Now 10 000 students in Vinnytsia study&nbsp;food industry programs.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Today, the following companies operate in&nbsp;Vinnytsia food industry: Roshen, ViOil, Agrana Fruit, VHS, AVIS, Vinnytsia fruit concentrates and wines plant, Khlibprom.</span></p>\r\n</div>\r\n
2	1	en	2018-11-29 10:57:35.786714	2019-03-06 10:51:50.968836	Engineering	<div>\r\n<p><span style="font-size:20px;">Vinnytsia is a city which&nbsp;successfully develops&nbsp;the machine-building industry for a long time. The city produces a wide range of goods starts from electrodes for welding to the latest refrigeration equipment. Geography of trade with goods manufactured by the industry extends from the United States to China.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">The potential for development has the following sub-sectors:</span></p>\r\n\r\n<ul>\r\n\t<li><span style="font-size:20px;">refrigeration equipment</span></li>\r\n\t<li><span style="font-size:20px;">electronics and electrical appliances</span></li>\r\n\t<li><span style="font-size:20px;">instrumentation</span></li>\r\n</ul>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">In Vinnytsia every year about 1200 specialists in&nbsp;engineering&nbsp;are finishing their education, which is a significant advantage for the further development of the industry&nbsp;and increasing of&nbsp;the skilled and competent labor force for local enterprises.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">The volume of sales&nbsp;related to the machine-building industry, for the January-September period,&nbsp;amount&nbsp;up to UAH 870 073, representing 3.9% of the total sales in the city.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Today in Vinnytsia mechanical engineering operates&nbsp;following companies: LLC Green Cool (UBC Group), LLC Electric Systems (a joint venture of Delphi and Ukroboronprom), PJSC Vinnytsia Mayak Plant, PJSC PlasmaTek, LLC PromAvtomatyka Vinnytsia, LLC&nbsp;Vinnitsa Pneumatics plant.</span></p>\r\n</div>\r\n
3	2	uk	2018-11-29 11:02:47.021922	2018-12-06 12:22:42.188182	Харчова промисловість 	<div>\r\n<p><span style="font-size:20px;">Завдяки вигідному розташуванню у центрі великого сільськогосподарського регіону, Вінниця є важливим центром харчової промисловості.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Основною &laquo;розумною&raquo; спеціалізацією міста було визначено - виробництво харчових продуктів, які відповідають світовим стандартам якості. Данна галузь становить 50% від загального промислового виробництва міста</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Обсяг реалізованої продукції що відноситься до галузі харчової промисловості, станом на січень-вересень склала 11&nbsp;439&nbsp;401,7 тис. грн, що являє собою 52,1% від усієї реалізованої продукції у місті.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Вінницька область &ndash; лідер у обсягах вирощування багатьох типів сільського-господарських культур, та один з найбільш сприятливих регіонів для вирощування сільсько-господарської продукції. В області ступінь сільсько-господпрського освоєння земель становить 76 .</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">У місті, за спеціальностями пов&rsquo;язаними з харчовою промисловістю навчаються 10 тисяч студентів.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Сьогодні у галузі&nbsp;Харочової промисловості&nbsp;м. Вінниці працюють такі компанії: Roshen, ViOil, Agrana Fruit, ВХС, АВІС, Вінницький завод фруктових концентратів та вин, Хлібпром.</span></p>\r\n</div>\r\n
9	5	uk	2018-11-29 11:27:07.138623	2018-12-06 12:03:29.883696	Комп’ютерна інженерія, ІТ	<div>\r\n<p><span style="font-size:20px;">Кількість&nbsp;IT&nbsp;компаній у місті стрімко росте, адже індустрія постійно підтримується зростаючою кількістю&nbsp;IT-талантів.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Завдяки цьому, Вінниця є одним з найперспективніших українських міст в плані розміщення ІТ-компаній. У місті ІТ-сектор постійно підтримується набором талантів, щороку місцеві ВНЗ випускають понад 700 кваліфікованих, готових до роботи в цій професії спеціалістів.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Крім того, розмір ринку, на якому вже працює понад 2 тис. чоловік, що являє собою 2% від загальноукраїнського ринку, також дає можливість знайти досвідчених фахівців з інформаційних технологій.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Додатково, варто зазначити, що за кількість IT &ndash; спеціалістів Вінниця посідай 6-те місце серед усіх міст України, що без сумніві є значним показником.&nbsp;&nbsp; &nbsp;</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Індикатором того що місто заццікавлене у розвитку цієї галузі є те що за даними аналізу ГО &laquo;Подільська агенція регіонального розвитку&raquo; та &laquo;ОПОРИ&raquo; Вінниця являється одним з лідерів України у впровадженні інструментів е-урядування</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Сьогодні у IT галузі м. Вінниці працюють такі компанії: EPAM, Ciclum, Sigma Software, Playtika, UA, Astound Commerce, Onseo, CoreValue, Delphi Software.</span></p>\r\n</div>\r\n
8	4	en	2018-11-29 11:16:25.040949	2019-01-23 14:31:10.316574	Light industry	<div>\r\n<p><span style="font-size:20px;">The production of the textile industry in Vinnytsia is in demand and exported to the European and many other countries.<br />\r\nThe volume of sales related to light industry, for January-September, amounted to UAH 173 947, which represents 2.3% of the total sales in the city.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">The development of light industry in Vinnytsia is supported by vocational schools, which cooperate with local enterprises for the creation of training programs adapted to the needs of the market and in order to be able to provide the industry with skilled labour. In 5 Vinnytsia vocational schools study 5 518 students.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Today, the following companies operate Vinnytsia in Light industry: PJSC &quot;VLODARKA&quot;, Closed Joint-Stock Company &quot;Vinnitschanka&quot;.</span></p>\r\n</div>\r\n
6	3	en	2018-11-29 11:04:18.900031	2019-03-06 13:18:43.861506	Biotechnology and pharmacy	<div>\r\n<p><span style="font-size:20px;">Biotechnology and pharmacy are&nbsp;sectors with the most favorable conditions for growth in Vinnytsia. As a result, this economy branch shows rapid development.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">This sector is allocated at the expense of the academic factor - a powerful educational sector of the city is represented by the Vinnitsa National Medical University and Vinnitsa Medical College, where are trained highly skilled future labor for biotech and pharmaceutical companies.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">The volume of sales related to the&nbsp;biotechnology and pharmacy, for January-September, amounted to UAH 499 381, which represents 2.3% of the total sales in the city.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">In the city, there are 8 scientific laboratories at the medical university, where were conducted more than 100 scientific clinical trials over the last 5 years.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Today, the following companies operate in Vinnytsia biotechnology and pharmacy: &nbsp;Sperko Ukraine, Trade House &quot;ENZIM&quot;.</span></p>\r\n</div>\r\n
11	6	uk	2018-11-29 11:31:52.806955	2018-12-11 14:26:50.740243	Креативні індустрії	<div>\r\n<p><span style="font-size:20px;">Цей напрямок набуває все більшого розвитку у межах міста, сучасний стан формування креативних індустрій вказує на їх урбаністичну орієнтацію&nbsp;та кластерну модель організації - ІТ-сфера, мистецтво, освіта, дизайн.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Водночас у Вінниці поки що не створено повноцінної інфраструктури креативних індустрій, хоча активно розвиваються різноманітні організаційні креативні хаби: коворкінги, майстерні, інкубатори, лабораторії і кластери. Ці нові простори дають змогу більшій чисельності людей продуктивно реалізувати й розвивати власні таланти та творчі здібності.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Місто вже працює над формуванням повноцінної інфраструктури креативних індустрій &ndash; що походять з індивідуальної творчості, навичок і талантів, та мають потенціал до формування добробуту і створення робочих місць через генерування та економічну реалізацію об&rsquo;єктів інтелектуальної власності.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">У місті вже створено:&nbsp;HUB&nbsp;&laquo;Місто Змістів&raquo;, Креативний простір &laquo;iHUB&raquo;, Креативний простір &laquo;Артинов&raquo;, креативний простір &laquo;CHERDAK&raquo;, Молодіжний центр &laquo;Квадрат&raquo;.</span></p>\r\n</div>\r\n
1	1	uk	2018-11-29 10:57:35.783969	2019-01-23 10:51:59.796608	Машинобудування	<div>\r\n<p><span style="font-size:20px;">Вінниця протягом довгого часу є містом у якому успішно розвивається галузь машинобудування. У місті виробляється широкий спектр продукції від електродів для зварювання до новітнього холодильного обладнання. Географія торгівлі товарами виготовленими галуззю поширюється від США до Китаю</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Потенціал для розвитку мають такі підгалузі, як:</span></p>\r\n\r\n<ul>\r\n\t<li><span style="font-size:20px;">холодильне обладнання та устаткування,</span></li>\r\n\t<li><span style="font-size:20px;">електроніка та електротехніка,</span></li>\r\n\t<li><span style="font-size:20px;">приладобудування;</span></li>\r\n</ul>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">За напрямом &laquo;Інженерія&raquo; у Вінниці щороку випускається близько 1200 спеціалістів, що є значною перевагою для подальшого розвитку галузі, та забезпечення місцевих підприємств кваліфікованою та компетентною робочою силою.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Обсяг реалізованої продукції що відноситься до галузі машинобудування, станом на січень-вересень склала 870&nbsp;073,4 тис. грн, що являє собою 3,9% від усієї реалізованої продукції у місті.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Сьогодні у галузі машинобудування м. Вінниці працюють такі компанії: ТОВ &laquo;Грін Кул&raquo; (UBC Group), ДП &laquo;Електричні системи&raquo; (спільне підприємство Delphi та Укроборонпромом), ПрАТ &laquo;Вінницький завод &laquo;Маяк&raquo;, ПАТ &quot;ПлазмаТек&quot;, ТОВ &quot;ПромАвтоматика Вінниця&quot;, ТОВ &laquo;Вінницький завод &laquo;Пневматика&raquo;.</span></p>\r\n</div>\r\n
10	5	en	2018-11-29 11:27:07.140767	2019-01-23 16:20:00.693287	Computer engineering, IT	<div>\r\n<p><span style="font-size:20px;">The number of IT companies in the city is rapidly growing, the&nbsp;industry is constantly supported by an increasing number of IT talents.<br />\r\nDue to this, Vinnytsia is one of the most promising Ukrainian cities in terms of IT companies hosting. The city IT sector is constantly supported by a set of talents. Each year, local universities produce more than 700 qualified, ready-to-work specialists.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">In addition, the size of the market, which already employs over 2 000 people&nbsp;representing 2% of the Ukrainian market and also provides an opportunity to find experienced IT professionals.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">In addition, it should be noted that for the number of IT specialists Vinnitsa ranked 6th among all the Ukrainian cities, which is undoubtedly a significant indicator.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">An indicator of the fact that the city is interested in the development of this industry is that, according to the analysis of NGO &quot;Podillya Regional Development Agency&quot; and &quot;OPORA&quot;, Vinnytsia is one of the leaders of Ukraine in the implementation of e-government tools</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Today in the IT industry of Vinnytsia there are such companies as EPAM, Ciclum, Sigma Software, Playtika, UA, Astound Commerce, Onseo, CoreValue, Delphi Software.</span></p>\r\n</div>\r\n
5	3	uk	2018-11-29 11:04:18.898276	2018-12-06 12:25:54.563719	Біотехнології та фармація	<div>\r\n<p><span style="font-size:20px;">Біотехнології&nbsp;та фармація є одним із секторів з найбільш сприятливими умовами для зростання у Вінниці. Як наслідок, ця галузь економіки свідчить про швидкий розвиток.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Те, що виділяє цей сектор, є академічний фактором - потужний освітній сектор міста представлений Вінницьким національним медичним університетом, та Вінницьким медичним коледжем, де навчаються висококваліфіковані майбутні працівники біотехнологічних та фармацевтичних компаній.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Обсяг рреалізованої продукції що відноситься до галузі біотехнології та фармації, станом на січень-вересень склала 499&nbsp;381,7 тис. грн, що являє собою 2,3% від усієї реалізованої продукції у місті.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">У місті, при медичному університеті працює 8 наукових лабораторій де за останні 5 років було проведено більше 100 наукових клінічних досліджень.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Сьогодні у галузі біотехнології та фармації&nbsp;м. Вінниці працюють такі компанії:&nbsp;Компанії міста - Сперко Україна, Торговий Дім &laquo;ЕНЗИМ&raquo;.</span></p>\r\n</div>\r\n
7	4	uk	2018-11-29 11:16:25.038734	2018-12-06 12:26:30.877145	Легка промисловість	<div>\r\n<p><span style="font-size:20px;">Продукція текстильної промисловості що виробляється у Вінниці користується попитом та експортується на ринок Європи та до багатьох інших країн.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Обсяг реалізованої продукції що відноситься до галузі легкої промисловості, станом на січень-вересень склала 173&nbsp;947,9 тис. грн, що являє собою 2,3% від усієї реалізованої продукції у місті.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">Розвиток легкої промисловості у Вінниці підтримується професійно-технічними училищами, які ведуть курс по співпраці з підприємствами у питанні підготовки навчальних програм, адаптованих до потреб ринку та для того щоб мати можливість забезпечити галузь кваліфікованими кадрами.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">У 9 професійно-технічних навчальних закладах Вінниці навчається 5 518 учнів. Сьогодні у галузі&nbsp;Легкої промисловості&nbsp;м. Вінниці працюють такі компанії:&nbsp;ПАТ &laquo;ВОЛОДАРКА&raquo;, Закрите акціонерне товариство &laquo;Вінничанка&raquo;</span></p>\r\n</div>\r\n
12	6	en	2018-11-29 11:31:52.809332	2018-12-13 16:19:51.919105	Creative industries	<div>\r\n<p><span style="font-size:20px;">This trend is becoming more and more developed within the city, the current state of the formation of creative industries indicates their urban orientation and the cluster model of organization - IT sphere, art, education, design.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">At the same time, Vinnytsia has not yet created a complete infrastructure of creative industries, although various organizational creative hubs are actively developing: coworkings, workshops, incubators, laboratories and clusters. These new spaces make it possible for a larger number of people to efficiently realize and develop their own talents and creative abilities.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">The city is already working on building a complete infrastructure of creative industries - derived from individual creativity, skills and talent, and has the potential for welfare creation and job creation through the generation and economic realization of intellectual property.</span></p>\r\n</div>\r\n\r\n<div>\r\n<p><span style="font-size:20px;">The city has already created: HUB &quot;City of Content&quot;, creative space &quot;iHUB&quot;, creative space &quot;Artinov&quot;, creative space &quot;CHERDAK&quot;, Youth Center &quot;Square&quot;.</span></p>\r\n</div>\r\n
